#1-2
def frequentWord(text, k):
    freqPat = set([])
    count = {}
    for i in range(len(text)-k):
        pattern = text[i:i+k]
        count[i] = patternCount(text, pattern)
    maxCount = max(count.values())
    for i in range(len(text)-k):
        if count[i] == maxCount:
            freqPat.add(text[i:i+k])       
    return freqPat

