#1-3 Reverse Complement Problem: Find the reverse complement of a DNA string.
def reverseComplement(text):
    char_dict = {"A":"T", "T":"A", "G":"C", "C":"G"}
    result = ""
    for char in text:
        result += char_dict[char]
    return result[::-1]
